func TestMain(m *testing.M) {
	c := m.Run()
	chaincfg.ResetParams()
	os.Exit(c)
}

func Test_GetAddrDescFromAddress_Mainnet(t *testing.T) {
	type args struct {
		address string
	}
	tests := []struct {
		name    string
		args    args
		want    string
		wantErr bool
	}{
		{
			name:    "P2PKH1",
			args:    args{address: "VRZF4Am891FS224uuNirsrEugqMyg3VxjJ"},
			want:    "76a914a36855abd93399fcc23439e90dce46724a95e47488ac",
			wantErr: false,
		},
        {
            name:    "BECH32",
            args:    args{address: "bv1q7uhwvymf865gsjgqmvuehkhew77e97zptqfagj"},
            want:    "0014f72ee613693ea8884900db399bdaf977bd92f841",
            wantErr: false,
        },
	}
	parser := NewVeilParser(GetChainParams("main"), &btc.Configuration{})

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := parser.GetAddrDescFromAddress(tt.args.address)
			if (err != nil) != tt.wantErr {
				t.Errorf("GetAddrDescFromAddress() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			h := hex.EncodeToString(got)
			if !reflect.DeepEqual(h, tt.want) {
				t.Errorf("GetAddrDescFromAddress() = %v, want %v", h, tt.want)
			}
		})
	}
}

func Test_GetAddressesFromAddrDesc(t *testing.T) {
	type args struct {
		script string
	}
	tests := []struct {
		name    string
		args    args
		want    []string
		want2   bool
		wantErr bool
	}{
		{
			name:    "P2PKH1",
			args:    args{script: "76a914a36855abd93399fcc23439e90dce46724a95e47488ac"},
			want:    []string{"VRZF4Am891FS224uuNirsrEugqMyg3VxjJ"},
			want2:   true,
			wantErr: false,
		},
        {
            name:    "BECH32",
            args:    args{script: "0014f72ee613693ea8884900db399bdaf977bd92f841"},
            want:    []string{"bv1q7uhwvymf865gsjgqmvuehkhew77e97zptqfagj"},
            want2:   true,
            wantErr: false,
        },
		{
			name:    "zerocoinspend",
			args:    args{script: ""},
			want:    []string{"Zerocoin Spend"},
			want2:   false,
			wantErr: false,
		},
		{
			name:    "zerocoinmint",
			args:    args{script: "c10280004c807b881c6ed52bde2cc63909d9ab61c23c02a066693acf0a19ea770753768680cd5e79ee3b0ea3ca8cc780efdc1545059fe0954218a6c47429c83f7f97099f749bcffe2d6dde4528a5924c7decc62154e6b36c4a1a537f00a8e4ba5973d64cd6db954ea461cb215843d497226cbe73a3e4ae2f7358d9c522e12266828cf0ee1662"},
			want:    []string{"Zerocoin Mint"},
			want2:   false,
			wantErr: false,
		},
	}

	parser := NewVeilParser(GetChainParams("main"), &btc.Configuration{})

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			b, _ := hex.DecodeString(tt.args.script)
			got, got2, err := parser.GetAddressesFromAddrDesc(b)
			if (err != nil) != tt.wantErr {
				t.Errorf("GetAddressesFromAddrDesc(%s) error = %v, wantErr %v", tt.name, err, tt.wantErr)
				return
			}
			if !reflect.DeepEqual(got, tt.want) {
				t.Errorf("GetAddressesFromAddrDesc(%s) = %v, want %v", tt.name, got, tt.want)
			}
			if !reflect.DeepEqual(got2, tt.want2) {
				t.Errorf("GetAddressesFromAddrDesc(%s) = %v, want %v", tt.name, got2, tt.want2)
			}
		})
	}
}

