func Test_PackTx(t *testing.T) {
	type args struct {
		tx        bchain.Tx
		height    uint32
		blockTime int64
		parser    *VeilParser
	}
	tests := []struct {
		name    string
		args    args
		want    string
		wantErr bool
	}{
		{
			name: "Veil-1",
			args: args{
				tx:        testTx1,
				height:    67786,
				blockTime: 1550655689,
				parser:    NewVeilParser(GetChainParams("main"), &btc.Configuration{}),
			},
			want:    testTxPacked1,
			wantErr: false,
		},
		{
			name: "Veil-2",
			args: args{
				tx:        testTx2,
				height:    67784,
				blockTime: 1550655566,
				parser:    NewVeilParser(GetChainParams("main"), &btc.Configuration{}),
			},
			want:    testTxPacked2,
			wantErr: false,
		},
		{
			name: "Veil-3",
			args: args{
				tx:        testTx3,
				height:    67722,
				blockTime: 1550651954,
				parser:    NewVeilParser(GetChainParams("main"), &btc.Configuration{}),
			},
			want:    testTxPacked3,
			wantErr: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := tt.args.parser.PackTx(&tt.args.tx, tt.args.height, tt.args.blockTime)
			if (err != nil) != tt.wantErr {
				t.Errorf("packTx() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			h := hex.EncodeToString(got)
			if !reflect.DeepEqual(h, tt.want) {
				t.Errorf("packTx() = %v, want %v", h, tt.want)
			}
		})
	}
}

func Test_UnpackTx(t *testing.T) {
	type args struct {
		packedTx string
		parser   *VeilParser
	}
	tests := []struct {
		name    string
		args    args
		want    *bchain.Tx
		want1   uint32
		wantErr bool
	}{
		{
			name: "Veil-1",
			args: args{
				packedTx: testTxPacked1,
				parser:   NewVeilParser(GetChainParams("main"), &btc.Configuration{}),
			},
			want:    &testTx1,
			want1:   67786,
			wantErr: false,
		},
		{
			name: "Veil-2",
			args: args{
				packedTx: testTxPacked2,
				parser:   NewVeilParser(GetChainParams("main"), &btc.Configuration{}),
			},
			want:    &testTx2,
			want1:   67784,
			wantErr: false,
		},
		{
			name: "Veil-3",
			args: args{
				packedTx: testTxPacked3,
				parser:   NewVeilParser(GetChainParams("main"), &btc.Configuration{}),
			},
			want:    &testTx3,
			want1:   67722,
			wantErr: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			b, _ := hex.DecodeString(tt.args.packedTx)
			got, got1, err := tt.args.parser.UnpackTx(b)
			if (err != nil) != tt.wantErr {
				t.Errorf("unpackTx() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if !reflect.DeepEqual(got, tt.want) {
				t.Errorf("unpackTx() got = %v, want %v", got, tt.want)
			}
			if got1 != tt.want1 {
				t.Errorf("unpackTx() got1 = %v, want %v", got1, tt.want1)
			}
		})
	}
}
